import React, { Component } from "react";
import { fetchApi } from "../action/Action";
import { connect } from "react-redux";
//import { List, Avatar } from 'antd';
//import 'antd/dist/antd.less';

import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import Divider from '@material-ui/core/Divider';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';


const useStyles = makeStyles(theme => ({
    root: {
      width: '100%',
      maxWidth: 360,
      backgroundColor: theme.palette.background.paper,
    },
    inline: {
      display: 'inline',
    },
  }));

class ListView extends Component {

    constructor(props) {
        super(props);
        this.state = {
            data: []
        };
    }

    componentDidMount() {
        this.props.fetchApi()
    }

    render() {
        const classes = useStyles();
        const { reducerListData, data } = this.props
        const propsData = Array.from(reducerListData)

        //console.log('reducerList',data)
        return (
            <div>
                <h1>Welcome to ListView page</h1>
                {propsData ? propsData.map(item => {
                    return (
                        <ListItem alignItems="flex-start">
                            <ListItemAvatar>
                                <Avatar alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
                            </ListItemAvatar>
                            <ListItemText
                                primary="Brunch this weekend?"
                                secondary={
                                    <React.Fragment>
                                        <Typography
                                            component="span"
                                            variant="body2"
                                            className={classes.inline}
                                            color="textPrimary"
                                        >
                                            Ali Connors
                                        </Typography>
                                        {" — I'll be in your neighborhood doing errands this…"}
                                    </React.Fragment>
                                }
                            />
                        </ListItem>
                    )
                }) : ''}

            </div>
        );
    }
}

const mapStateToProps = state => {
    console.log('state', state)
    return {
        reducerListData: state
    };
};

const mapDispatchToProps = dispatch => {
    console.log('dispatch', dispatch)
    return {
        fetchApi: () => dispatch(fetchApi())
    };
};



export default connect(
    mapStateToProps,
    mapDispatchToProps
)(ListView);
